import React, { Fragment } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Style from './style';

function Home() {
  return (
    <Fragment>
      <Style />
      <div class="w-100 Welcome-sec">
            <div className="right">
              WELCOME
            </div>
            <div className="left">
              <img src="/" alt="" />
            </div>
      </div>  
    </Fragment>
  );
}

export default Home;
